import React from 'react';
import { Bar } from 'react-chartjs-2';
import { Card, CardContent, Typography, Grid } from '@mui/material';

const DashboardChimistes = () => {
  // Exemple de données pour les graphiques
  const data = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      {
        label: 'Conceptions de Médicaments',
        data: [10, 15, 20, 25, 30, 35],
        backgroundColor: 'rgba(75, 192, 192, 0.6)',
        borderColor: 'rgba(75, 192, 192, 1)',
        borderWidth: 1,
      },
    ],
  };

  return (
    <div style={{ padding: '20px' }}>
      <Typography variant="h4" gutterBottom>
        Tableau de Bord des Chimistes
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h5">Conceptions de Médicaments</Typography>
              <Bar data={data} options={{ responsive: true }} />
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h5">Modélisation Moléculaire</Typography>
              <Typography variant="body1">
                Utilisez cet espace pour visualiser et analyser des structures moléculaires.
              </Typography>
              {/* Ici, vous pouvez intégrer un visualiseur moléculaire */}
              <div id="molecule-viewer" style={{ height: '300px', backgroundColor: '#f0f0f0' }}>
                {/* Intégration d'une bibliothèque de visualisation comme 3Dmol.js */}
                <p>Visualiseur moléculaire à intégrer ici.</p>
              </div>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12}>
          <Card>
            <CardContent>
              <Typography variant="h5">Statistiques des Projets</Typography>
              <Typography variant="body1">Nombre total de projets en cours : 5</Typography>
              <Typography variant="body1">Projets terminés : 12</Typography>
              <Typography variant="body1">Projets en attente : 3</Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
};

export default DashboardChimistes;
